css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix(http://www.google),
               url-prefix(https://encrypted.google),
               url-prefix(https://www.google) 
{
  #lga{
    background-image: url(https://upload.wikimedia.org/wikipedia/commons/3/30/Googlelogo.png);
    background-size: 272px 92px;
    background-repeat: no-repeat;
    background-position: center 109px
  }
  #hplogo, a#logo img{
    display: none
  }
  a#logo{
    background: url(https://upload.wikimedia.org/wikipedia/commons/3/30/Googlelogo.png) no-repeat;
    background-size: 95px 35px;
  }
}
